import '../Extras/Admin_sidebar.css'

const initialState = () =>{
    return(
        <>
        <div className="sidenav">
            <a href="#about">About</a>
            <a href="#services">Services</a>
            <a href="#clients">Clients</a>
            <a href="#contact">Contact</a>
        </div>
    </>
    )
}

const admin_analysis = () =>{
    return(
        <>
            <div className="sidenav">
                <a href="#overall">Overall</a>
                <a href="#analysis">Analysis- filter by organization</a>    
            </div>
        </>
    )
}

const admin_organization = () =>{
    return(
        <>
        <div className="sidenav">
            <form className="form-inline my my-lg-0">
                <input className="form-control mr-sm-2" type="search" placeholder="Search ORG" aria-label="Search"></input>
                <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
            </form>
            <a href="#filters">Filters</a>
        </div>
    </>
    )
}
const admin_feedback = () =>{
    return(
        <>
        <div className="sidenav">
            <h3>Send us your FEEDBACK</h3>
        </div>
        <form>
            <div className="form-group">
                <label htmlFor="exampleFormControlTextarea1">Example textarea</label>
                <textarea className="form-control" id="exampleFormControlTextarea1" rows="8"></textarea>
            </div>
        </form>
        <div>
        <button type="button" className="btn btn-primary">Primary</button>
        </div>
    </>
    )
}
const side_bar_update = (state = initialState(), action) =>{
    switch(action.type){
        case "admin_home": return initialState();
        case "admin_analysis": return admin_analysis();
        case "admin_organization": return admin_organization();
        case "admin_feedback": return admin_feedback();
        default: return initialState();
    }
}

export default side_bar_update;
